import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import NavbarComponent from './component/NavbarComponent';
import {BroswerRouter, Route} from 'react-router-dom'

function App() {
  return (
    <BroswerRouter>
    <Route>
      <NavbarComponent />
    </Route>
    </BroswerRouter>
  );
}

export default App;
